import{_ as t}from"./plugin-vue_export-helper-c27b6911.js";import{o as d,c as r,b as e}from"./app-ba3f6679.js";const s={},n=e('<h1 id="宽带" tabindex="-1"><a class="header-anchor" href="#宽带" aria-hidden="true">#</a> 宽带</h1><h2 id="_1-网线" tabindex="-1"><a class="header-anchor" href="#_1-网线" aria-hidden="true">#</a> 1. 网线</h2><table><thead><tr><th></th><th>CAT.5</th><th>CAT.5E</th><th>CAT.6</th><th>CAT.6A</th><th>CAT.7</th><th>CAT.8</th></tr></thead><tbody><tr><td>传输速率</td><td>100Mbps</td><td>1000Mbps</td><td>1Gbps</td><td>10Gbps</td><td>10Gbps</td><td>25/40Gbps</td></tr><tr><td>传输频率</td><td>100MHz</td><td>100MHz</td><td>250MHz</td><td>500MHz</td><td>600MHz</td><td>2000MHz</td></tr><tr><td>最大距离</td><td>100m</td><td>100m</td><td>100m</td><td>100m</td><td>100m</td><td>30m</td></tr><tr><td>线缆类型</td><td>非屏蔽</td><td>屏蔽/非屏蔽</td><td>屏蔽/非屏蔽</td><td>屏蔽/非屏蔽</td><td>双层屏蔽</td><td>双层屏蔽</td></tr></tbody></table><blockquote><p><em><strong>(1Gbps = 1024Mbps)</strong></em><br> *Mbps(Million bits per second)，是一种传输速率单位，指每秒传输的位(比特)数量。<br> 1Mbps代表每秒传输1000000位(bit)，即每秒传输的数据量为: 1000000/8 =125000Byte/s = 125Kb/s = 0.125Mb/s<br> Byte代表字节，8个二进制位为一个字节，即1Byte = 8bit<br><strong>Mbps衡量的是单位时间内线路传输的二进制位的数量</strong></p><p><em>Mhz(Mega Hertz)，兆赫，波动频率单位之一<br> Hz指的是线缆的频率带宽，代表的是<strong>单位时间内线路中电信号的震荡次数</strong></em></p><p><em>非屏蔽（UTP）、单屏蔽（FTP）、双屏蔽（SFTP） 屏蔽线就是在绝缘层内部增加了一层金属屏蔽层</em></p></blockquote><h3 id="_1-1-网线分类" tabindex="-1"><a class="header-anchor" href="#_1-1-网线分类" aria-hidden="true">#</a> 1.1 网线分类</h3><p>目前的网线主要分为：五类、超五类、六类、超六类、七类、八类<br> 在普通家用环境下，超五类，六类也可以支持到万兆。级别越高，万兆支持越稳定。</p><p><strong>五类网线</strong>：网线外侧有CAT.5标记，最高传输频率为 100MHz，传输速率为 100Mbps，适用于百兆以下的网络，但目前已基本不再使用<br><strong>超五类网线</strong>：网线外侧有CAT.5E <em>( Enhanced )</em> 标记，最高传输频率为 100MHz，传输速率为 1000Mbps，适用于千兆网络上。<br><em>(目前大部分的网线都是超五类的，尤其是家里自用的)</em></p><p><strong>六类网线</strong>：网线外侧有CAT.6标记，最高传输频率为 250MHz，传输速率为 1Gbps，适用于千兆网络。<br><strong>超六类网线</strong>：网线外侧有CAT.6A <em>( Augmented )</em> 标记，最高传输频率为 500MHz，传输速率为 10Gbps，适用于万兆网络。</p><p><strong>七类网线</strong>：网线外侧有CAT.7标记，最高传输频率为 600MHz，传输速率为 10Gbps。<br><strong>八类网线</strong>：网线外侧有CAT.8标记，最高传输频率为 2000MHz，传输速率为 25/40Gbps。<br><em>(一般为数据中心、高速和宽带密集型应用)</em></p><h3 id="_1-2-网线品牌" tabindex="-1"><a class="header-anchor" href="#_1-2-网线品牌" aria-hidden="true">#</a> 1.2 网线品牌</h3><p><strong>国际知名的综合布线品牌：</strong> TP-LINK、泛达、日线、普天、康普、一舟、天诚、罗格朗，爱谱华顿、大唐电信</p><p><strong>国内面向消费者的消费级品牌：</strong> 山泽、绿联、秋叶原、万级、飞利浦、普网网联</p>',12),o=[n];function a(h,b){return d(),r("div",null,o)}const c=t(s,[["render",a],["__file","index.html.vue"]]);export{c as default};
